import React from 'react';
import catImage from "../image/cat.jpeg";

function HomePage() {

  const text = `21歳からITに関して興味を持ち始め、プログラミングを学び始めた現在22歳の学生。\n フロントエンジニアをめざしReactを猛勉強中。帰国子女であるため英語で会話可能。`
  return (
    <div>
      <div className='me'>
        <div className='me-information'>
          <h2>Kei Nakamura</h2>
          <div className='catimage'>
            <img src={catImage} />
            <div className='me-information-myself'>
              21歳からITに関して興味を持ち始め、プログラミングを学び始めた現在22歳の学生。

            </div>
          </div>
        </div>
      </div>
    </div>
  )
}

export default HomePage;
